import Recat, { useState } from "react"

const Page = (P) => {
    const [selectedRouteIndex, setSelectedRouteIndex ] = useState(0);

    return( P.bind(null, {selectedRouteIndex: 0}))
        // <main>
        //     { P.bind(null, {selectedRouteIndex: 0}) }
        // </main>
    //)
}

export default Page;
